  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'RKE 插件'
};
export const metadata = {
  "id": "rke/config-options/add-ons/_index",
  "title": "RKE 插件",
  "description": "RKE 支持在集群 yaml 文件中配置插件选项，这些插件用于部署多种集群组件，包括：",
