export const rightToc = [{
  value: '关键插件与非关键插件',
  id: '关键插件与非关键插件',
  children: []
}, {
  value: '插件部署 job',
  id: '插件部署-job',
  children: []
}, {
  value: 'Add-on 位置',
  id: 'add-on-位置',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`RKE 支持在集群 yaml 文件中配置插件选项，这些插件用于部署多种集群组件，包括：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rke/config-options/add-ons/network-plugins/_index"
        }}>{`网络插件`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rke/config-options/add-ons/ingress-controllers/_index"
        }}>{`Ingress controller 插件`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rke/config-options/add-ons/dns/_index"
        }}>{`DNS 提供商插件`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rke/config-options/add-ons/metrics-server/_index"
        }}>{`Metrics Server 插件`}</a></li>
    </ul>
    <p>{`这些插件的镜像文件可以在`}<a parentName="p" {...{
        "href": "/docs/rke/config-options/system-images/_index"
      }}><inlineCode parentName="a">{`system_images`}</inlineCode></a>{`中找到。对于每个 Kubernetes 版本，都有与每个插件相关联的默认镜像版本，但这些镜像可以通过更改`}<inlineCode parentName="p">{`system_images`}</inlineCode>{`中的镜像来覆盖。`}</p>
    <p>{`注意：`}</p>
    <ul>
      <li parentName="ul">{`除了这些 RKE 已有的插件外，您在集群部署完成，部署自定义插件，详情请参考`}<a parentName="li" {...{
          "href": "/docs/rke/config-options/add-ons/user-defined-add-ons/_index"
        }}>{`自定义插件`}</a>{`。`}</li>
      <li parentName="ul">{`从 v0.1.8 开始，如果插件名称相同，RKE 会执行更新。`}</li>
      <li parentName="ul">{`在 v0.1.8 之前，您需要运行`}<inlineCode parentName="li">{`kubectl edit`}</inlineCode>{`命令更新插件。`}</li>
    </ul>
    <h2 {...{
      "id": "关键插件与非关键插件"
    }}>{`关键插件与非关键插件`}</h2>
    <p>{`从 v0.1.7 开始，插件被分为关键插件与非关键插件：`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`关键插件：`}</strong>{` 如果部署失败，会导致 RKE 报错。`}</li>
      <li parentName="ul"><strong parentName="li">{`非关键插件：`}</strong>{` 如果部署失败，RKE 会在日志中记录一条告警信息，并继续部署其他插件。`}</li>
    </ul>
    <p>{`当前只有`}<a parentName="p" {...{
        "href": "/docs/rke/config-options/add-ons/network-plugins/_index"
      }}>{`网络插件`}</a>{`是`}<strong parentName="p">{`关键插件`}</strong>{`，其他插件都是`}<strong parentName="p">{`非关键插件`}</strong>{`。`}</p>
    <h2 {...{
      "id": "插件部署-job"
    }}>{`插件部署 job`}</h2>
    <p>{`RKE 使用 Kubernetes job 的方式部署插件。在某些情况下，部署插件的时间会比预期时间长。从 v0.1.7 开始，RKE 提供集群层级的`}<inlineCode parentName="p">{`addon_job_timeout`}</inlineCode>{`选项，以检查 job 的连接是否超时，默认值为 30，单位是秒。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`addon_job_timeout: 30
`}</code></pre>
    <h2 {...{
      "id": "add-on-位置"
    }}>{`Add-on 位置`}</h2>
    <p><em parentName="p">{`v0.2.3 或更新版本可用`}</em></p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`组件`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`nodeAffinity nodeSelectorTerms`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`nodeSelector`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Tolerations`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Calico`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`beta.kubernetes.io/os:NotIn:windows`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`none`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`NoSchedule:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`NoExecute:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`CriticalAddonsOnly:Exists`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Flannel`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`beta.kubernetes.io/os:NotIn:windows`}</inlineCode></td>
          <td parentName="tr" {...{
