          }}>{`none`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`operator:Exists`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Canal`}</td>
          <td parentName="tr" {...{
