          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`beta.kubernetes.io/os:linux`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`NoSchedule:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`NoExecute:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`CriticalAddonsOnly:Exists`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`kube-dns`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`beta.kubernetes.io/os:NotIn:windows`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`node-role.kubernetes.io/worker`}</inlineCode>{` `}<inlineCode parentName="td">{`Exists`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`none`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`NoSchedule:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`NoExecute:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`CriticalAddonsOnly:Exists`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`nginx-ingress`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`beta.kubernetes.io/os:NotIn:windows`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`node-role.kubernetes.io/worker`}</inlineCode>{` `}<inlineCode parentName="td">{`Exists`}</inlineCode></td>
          <td parentName="tr" {...{
