          }}>{`- `}<inlineCode parentName="td">{`NoSchedule:Exists`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`NoExecute:Exists`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`metrics-server`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`- `}<inlineCode parentName="td">{`beta.kubernetes.io/os:NotIn:windows`}</inlineCode><br />{`- `}<inlineCode parentName="td">{`node-role.kubernetes.io/worker`}</inlineCode>{` `}<inlineCode parentName="td">{`Exists`}</inlineCode></td>
          <td parentName="tr" {...{
